import React from 'react';
import SearchBar from './SearchBar';

const Planner = ({ username }) => {
  const data = [
    'Apple',
    'Banana',
    'Cherry',
    'Date',
    'Elderberry',
    'Fig',
    'Grape',
  ];

  return (
    <div>
      <SearchBar username={username} data={data} />
    </div>
  );
};

export default Planner;
